import React from 'react';

const Astronomy = () => {

  const [astronomyData, setAstronomyData] = useState();

  const baseUrl = `http://api.weatherapi.com/v1/astronomy.json?key=b739f9dce98a4420b36175641221102&q=sunrise&aqi=no`
  const apiKey = 'b739f9dce98a4420b36175641221102';

  return <div><h1>{astronomyData.sunrise}</h1></div>;
};

export default Astronomy;
